const dadosApi = context.workflow['4447a4e2-dbe9-4cb1-9f1c-a5dbc4db24a5'].result?.['data'];

// --- O CÓDIGO COMEÇA ABAIXO DA VARIÁVEL QUE VOCÊ ARRASTOU ---

// 1. Verificação rápida
if (!dadosApi || !dadosApi.result) {
    console.warn("DEBUG: A variável 'dadosApi' está vazia ou sem 'result'.");
    return null;
}

// 2. Foca onde o Google coloca os dados
const googleResult = dadosApi.result;
const components = googleResult.address_components;
const geometry = googleResult.geometry;

// 3. Prepara o objeto vazio
let enderecoFinal = {
    cep: "",
    logradouro: "",
    municipio: "",
    bairro: "",
    numero: "",
    uf: "",
    latitude: 0,
    longitude: 0,
    end_completo: googleResult.formatted_address || ""
};

// 4. Pega Latitude e Longitude
if (geometry && geometry.location) {
    enderecoFinal.latitude = geometry.location.lat;
    enderecoFinal.longitude = geometry.location.lng;
}

// 5. Mapeia os componentes
if (Array.isArray(components)) {
    components.forEach(comp => {
        const tipos = comp.types; // <--- Aqui chamamos de "tipos"

        // Número da rua
        if (tipos.includes("street_number")) {
            enderecoFinal.numero = comp.long_name;
        }
        // Rua / Avenida
        if (tipos.includes("route")) {
            enderecoFinal.logradouro = comp.long_name;
        }
        // Bairro
        if (tipos.includes("sublocality_level_1") || tipos.includes("sublocality")) {
            enderecoFinal.bairro = comp.long_name;
        }
        // Cidade
        if (tipos.includes("administrative_area_level_2")) {
            enderecoFinal.municipio = comp.long_name;
        }
        // Estado (UF) - CORRIGIDO AQUI (estava "types", mudei para "tipos")
        if (tipos.includes("administrative_area_level_1")) {
            enderecoFinal.uf = comp.short_name;
        }
        // CEP
        if (tipos.includes("postal_code")) {
            enderecoFinal.cep = comp.long_name;
        }
    });
}

// 6. Retorna o objeto preenchido
return enderecoFinal;

